import React from "react";
import "../styles/TodoSearch.css";
const TodoSearch = () =>{
    const searchItems=(message)=>{
        console.log(message);
    }
    return (
        <input className="TodoSearch" placeholder="input para busquedas" onKeyPress={()=>searchItems()}/>
    );
}

export default TodoSearch;
